import './App.css';
import './index.css'
import React from 'react';
import Manager from './Manager';
import Server from './Server';
import Customer from './Customer';
import ReactDOM from 'react-dom/client';
import MapPage from './MapPage';
import { Button } from 'antd';
import { GoogleLogin } from 'react-google-login'
// Google api key
//AIzaSyD-5SlaVjpKarOG19ixO-c9v-0Q7oH3jnw

//client id
const clientID = '741259151635-g7v95ds2buolo7tu7ha7lnpr5549nli8.apps.googleusercontent.com'

//client secret
//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


function Auth_Signin() {

    function onSuccess(){
        console.log("success login")
        const root = ReactDOM.createRoot(document.getElementById('root'));
        root.render(
          <React.StrictMode>
            <Manager />
          </React.StrictMode>
        );
    }

    function onFailure(){
        console.log("Login Failure")
    }
  
  return (
    <div id='body'>
        
      <div class="headerdiv">
        Chick-fil-A!
      </div>
      <div>
        <header className="SelectRole">
          <div class="appHeader">
            Sign in with Google:
          </div>
        </header>
        <div className="container">
            <GoogleLogin
                clientId = {clientID}
                buttonText = "Login"
                onSuccess={onSuccess}
                onFailure={onFailure}
                cookiePolicy={'single_host_origin'}
                isSignedIn={true}
             
            />

        </div>
      </div>
      <div class="footerdiv">
        <Button class="returnButton" onClick={ReturnToManager}>Return</Button>
        
      </div>
    </div>

  );
}

export default Auth_Signin;
